BEGIN TRANSACTION;
DELETE FROM sqlite_sequence;
CREATE TABLE "schema_migrations" ("version" varchar(255) NOT NULL);
CREATE TABLE "picks" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "user" varchar(255), "ip" varchar(255), "win_pic_id" varchar(255), "loss_pic_id" varchar(255), "created_at" datetime, "updated_at" datetime);
CREATE TABLE "users" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "created_at" datetime, "updated_at" datetime);
CREATE TABLE pics (id INTEGER PRIMARY KEY, title varchar(255), description varchar(255), image_url varchar(255), created_at datetime, updated_at datetime, scores real, wins int, losses int);
CREATE UNIQUE INDEX "unique_schema_migrations" ON "schema_migrations" ("version");
COMMIT;
